// src/app/predict-land/predict-land.component.ts
import { Component } from '@angular/core';
import { NgForm } from '@angular/forms';
import { CurrencyService } from 'src/app/Services/currency.service';
import { PredictionService } from 'src/app/Services/prediction.service';


@Component({
  selector: 'app-predict-land',
  templateUrl: './predict-land.component.html',
  styleUrls: ['./predict-land.component.scss']
})
export class PredictLandComponent {
  year!: number;
  stateEncoded!: number;
  landUseEncoded!: number;

  predictedUSD: number | null = null;
  predictedTND: number | null = null;
  predicting = false;
  loadingRate = false;

  private inputDim = 25;

  constructor(
    private predictionService: PredictionService,
    private currencyService:   CurrencyService
  ) {}

  onSubmit(form: NgForm) {
    if (form.invalid) return;

    // Build the 25-element feature vector
    const zeros = Array(this.inputDim - 3).fill(0);
    const features = [
      this.year,
      this.stateEncoded,
      this.landUseEncoded,
      ...zeros
    ];

    this.predicting   = true;
    this.predictedUSD = null;
    this.predictedTND = null;

    // 1) Get USD prediction
    this.predictionService.predict(features).subscribe({
      next: ({ predicted_price }) => {
        this.predictedUSD = predicted_price;

        // 2) Then fetch the USD→TND rate
        this.loadingRate = true;
        this.currencyService.getUsdToTndRate().subscribe({
          next: rate => {
            this.predictedTND = this.predictedUSD! * rate;
            this.loadingRate = false;
            this.predicting  = false;
          },
          error: err => {
            console.error('Rate fetch error', err);
            this.predictedTND = NaN;    // signal failure
            this.loadingRate  = false;
            this.predicting   = false;
          }
        });
      },
      error: err => {
        console.error('Prediction error', err);
        this.predicting = false;
      }
    });
  }
}
<div class="container p-4">
  <h2>Land Price Prediction</h2>

  <form #predictForm="ngForm" (ngSubmit)="onSubmit(predictForm)">
    <!-- Year -->
    <div class="mb-3">
      <label for="year">Year</label>
      <input id="year" name="year" type="number" required
             class="form-control"
             [(ngModel)]="year" #yearCtrl="ngModel">
      <div *ngIf="yearCtrl.invalid && yearCtrl.touched" class="text-danger">
        Required
      </div>
    </div>

    <!-- State_encoded -->
    <div class="mb-3">
      <label for="state">State (encoded)</label>
      <input id="state" name="state" type="number" required
             class="form-control"
             [(ngModel)]="stateEncoded" #stateCtrl="ngModel">
      <div *ngIf="stateCtrl.invalid && stateCtrl.touched" class="text-danger">
        Required
      </div>
    </div>

    <!-- Land_use_encoded -->
    <div class="mb-3">
      <label for="landUse">Land Use (encoded)</label>
      <input id="landUse" name="landUse" type="number" required
             class="form-control"
             [(ngModel)]="landUseEncoded" #landUseCtrl="ngModel">
      <div *ngIf="landUseCtrl.invalid && landUseCtrl.touched" class="text-danger">
        Required
      </div>
    </div>

    <button type="submit"
            class="btn btn-primary"
            [disabled]="predictForm.invalid || predicting">
      {{ predicting ? 'Predicting…' : 'Predict Price' }}
    </button>
  </form>

  <div *ngIf="predictedUSD !== null" class="alert alert-success mt-4">
    <p><strong>Price (USD/m²):</strong> {{ predictedUSD | number:'1.2-2' }}</p>
    <p>
      <strong>Price (TND/m²):</strong>
      <ng-container *ngIf="!loadingRate; else loadingTpl">
        {{ predictedTND | number:'1.2-2' }}
      </ng-container>
      <ng-template #loadingTpl><em>loading…</em></ng-template>
    </p>
  </div>

  <div *ngIf="!predicting && predictedUSD===null && predictForm.submitted"
       class="alert alert-danger mt-4">
    Prediction failed. Please try again.
  </div>
</div>
